import React, { Component } from "react";
import App from "../App";
 
class Contact extends Component {
  render() {
    return (
      <>
        <App />
        {/* form_start(form) */}
          <div className="wrapper-form">
            <div className="box-form">

              <div className="item-form">
                <div className="label-form">Votre  Adresse  Email<span className="textNeeded-form">*</span></div>
                {/* form_widget(form.email, {'attr': {'className': 'textFields-form small', 'placeholder': 'truc@mail.com'}}) */}
              </div>

              <div className="item-form">
                <div className="label-form">Votre Message<span className="textNeeded-form">*</span></div>
                {/* form_widget(form.message, {'attr': {'className': 'textArea-form', 'placeholder': 'Bonjour Monsieur PERRET,'}}) */}
              </div>

              <input type="submit" className="item-form button-form" value="Envoyer votre message"/> 
              {/* formnovalidate pour ne pas avoir la validation HTML 5 */}

            </div>      
          </div>
        {/* form_end(form) */}
      </>
    );
  }
}
 
export default Contact;
